import pic from '../Media/young-tender-curly-girl-holding-documents.png'
import React, { useRef, useState } from 'react';
import Box from '@mui/material/Box';
import Stepper from '@mui/material/Stepper';
import Step from '@mui/material/Step';
import StepLabel from '@mui/material/StepLabel';
import Button from '@mui/material/Button';
const steps = ['1', '2', '3'];

export default function FormPage({navbarHeight}) {
  return (
    <div style={{marginTop:'90px'}}>
      <img src={pic} style={{width:'100%',height:'500px',objectFit:'cover'}}/>
      <div style={{ width: '100%',
     alignItems: 'start', backgroundColor: "#ECEAEA", justifyContent: 'center', 
     display: 'flex', backgroundSize: 'cover', height: windowHeight.current }}>
      <Box sx={{ width: '40%' ,padding:"40px"}}>
        <Stepper activeStep={activeStep}>
          {steps.map((label, index) => {
            const labelProps = {};
            return (
              <Step key={label}>
                <StepLabel StepIconComponent={StyledStepIcon} {...labelProps} sx={{ 
                    position:'relative'
                 }}>
                    <div style={{ position:"absolute", right:"28px", bottom:'10px',fontWeight:"bold"
                    ,color:"white",fontSize:"20px" }}>
                  {label}
                  </div>
                </StepLabel>
              </Step>
            );
          })}
        </Stepper>
        {activeStep === steps.length ? (
          <div>hello</div>
        ) : (
          <React.Fragment>
              {activeStep === 0 && (
                <div style={{ padding:'20px' }}>
               hi
                </div>
            )}
              {activeStep === 1 && (
                <div>
                hi
                </div>
            )}
               {activeStep === 2 && (
                hi
            )}
            <Box sx={{ display: 'flex', flexDirection: 'row' }}>
              <Button
                color="inherit"
                disabled={activeStep === 0}
                onClick={handleBack}
                sx={{ mr: 1, color:'#DD560A' }}
              >
                Back
              </Button>
              <Box sx={{ flex: '1 1 auto' }} />
             {activeStep !== steps.length - 1 ? 
             <Button onClick={handleNext} sx={{ color:'#DD560A' }}>
                Next
              </Button> : 
              <Button onClick={handleFinish} sx={{ color:'#DD560A' }}>
                Finish
              </Button>}
            </Box>
          </React.Fragment>
        )}
      </Box>
    </div>
    </div>
  )
}
